using System;\nusing System.Collections.Generic;\nusing System.IO;\n\npublic class AirportDataParser\n{\n    public List<Airport> ParseAirports(string filePath)\n    {\n        var airports = new List<Airport>();\n        \n        using (var reader = new StreamReader(filePath))\n        {\n            while (!reader.EndOfStream)\n            {\n                var line = reader.ReadLine();\n                var values = line.Split(',');\n                \n                if (values.Length > 14) // Ensure the line has enough data\n                {\n                    var airport = new Airport\n                    {\n                        ID = Convert.ToInt32(values[0].Trim('"')),\n                        Name = values[1].Trim('"'),\n                        City = values[2].Trim('"'),\n                        Country = values[3].Trim('"'),\n                        IATACode = values[4].Trim('"')\n                    };\n                    \n                    airports.Add(airport);\n                }\n            }\n        }\n\n        return airports;\n    }\n}\n\npublic class Airport\n{\n    public int ID { get; set; }\n    public string Name { get; set; }\n    public string City { get; set; }\n    public string Country { get; set; }\n    public string IATACode { get; set; }\n}